import React from "react";
import { useNavigate } from "react-router-dom";
import "../App.css";

const LandingPage = () => {
  const navigate = useNavigate();

  return (
    <div className="landing-container">
      <h1 className="title">Historian Dictionary</h1>
      <p className="description">
        The Dictionary Grammar and Spelling Checker is a Python-based tool designed to correct
        common errors while recognizing foreign words, proper nouns, and specialized terms.
        With sentence-level implementation by Jerry and word-level focus separately managed,
        this program ensures accurate and context-aware corrections tailored for dictionary use.
      </p>
      <div className="button-container">
        <button className="main-button" onClick={() => navigate("/edit-document")}>
          Edit Document
        </button>
        <button className="main-button" onClick={() => navigate("/data-storage")}>
          Data Storage
        </button>
      </div>
      <p className="credit">Credit @Duke University</p>
    </div>
  );
};

export default LandingPage;
